import React from 'react';
import './App.css';
import Checkout from './Checkout'
import Success from './Success'
import Cancel from './Cancel'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const routes = [
  {
    path: "/success",
    component: Success
  },
  {
    path: "/cancel",
    component: Cancel
  },
  {
    path: "/",
    component: Checkout2
  }
];

function App() {
  return (
   <div>
     <Router>
     <Switch>
          {routes.map((route, i) => (
            <Route key={i} {...route} />
          ))}
        </Switch>
             </Router>

    </div>
  );
}

export default App;
